import Calendar from './Calendar'
import { Container } from '@material-ui/core'
import { makeStyles } from 'react'

const useStyles = makeStyles((theme) => ({
    center: {
        alignItems: 'center',
    }
}))

const Schedule = () => {
    return (
        <Container >
            <h1>Calender</h1>
                <Calendar />
        </Container>
    )
}

export default Schedule
